import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './components/Home';
import LiteratureSurvey from './components/LiteratureSurvey';
import Methodology from './components/Methodology';
import ResultsApplications from './components/ResultsApplications';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        {/* Navigation Bar */}
        <nav className="bg-white shadow-md fixed w-full top-0 left-0 z-50 rounded-sm">
          <div className="container mx-auto px-4">
            <div className="flex justify-between items-center py-4">
              <Link to="/" className="text-xl font-bold text-gray-800">aes-des</Link>
              <ul className="flex space-x-6 ">
                <li><NavLink to="/">Home</NavLink></li>
                <li><NavLink to="/literature-survey">Literature Survey</NavLink></li>
                <li><NavLink to="/methodology">Methodology</NavLink></li>
                <li><NavLink to="/results-applications">Results</NavLink></li>
              </ul>
            </div>
          </div>
        </nav>

        {/* Main Content */}
        <div className="container mx-auto px-4 pt-20">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/literature-survey" element={<LiteratureSurvey />} />
            <Route path="/methodology" element={<Methodology />} />
            <Route path="/results-applications" element={<ResultsApplications />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

const NavLink = ({ to, children }) => (
  <Link
    to={to}
    className="text-gray-600 hover:text-black transition-colors duration-300  text-sm font-semibold"
  >
    {children}
  </Link>
);

export default App;
